sub crypt_b
{
	my $self = shift;
	return Crypt::CBC->new( -key    => $self->dbdata->{md5_secret},
                             -cipher => 'Blowfish'
                            );

}
sub auth_adm
{
	my $self = shift;
	my($username, $password, $env) = @_;
	print STDERR $env->{HTTP_X_COUNTRYCODE} . "\n";
	#if ($env->{HTTP_X_COUNTRYCODE} eq 'RU') { return 0; }
	return $username eq 'admin' && $password eq $self->dbdata->{'adm_password'} || $username =~ /^trade_/ && $password eq $self->dbdata->{$username . "_password"};
}


sub db_adv
{
	my $self =  shift;
	my $options = shift || {};

	if (!exists($options->{server_id})) { $options->{server_id} = $self->dbdata->{current_server}; }
	
	if (!ref($self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'})) { 

		return $self->db($options);

		#$self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'} = $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB'};

		#return undef;
	}

	if ($ENV{'DB_ADV_NAME'}) { $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'}->{'NAME'} = $ENV{'DV_ADV_NAME'}; }

	load_class('DBD::' . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'}->{'DRV'});
	#load_class('Tie::Cache::LRU');

	if (!$self->db_pool_adv->{$$ . "_" . $options->{server_id}} || $options->{force}) {
		$self->db_pool_adv->{$$ . "_" . $options->{server_id}} = DBI->connect("dbi:" . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'}->{'DRV'} . ":dbname=" . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'}->{'NAME'} . ";port=" . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'}->{'PORT'} . ";host=" . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'}->{'HOST'}, 
				$self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'}->{'USER'}, $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB_ADV'}->{'PASSWD'},
			{
				pg_auto_escape => 1,
				pg_enable_utf8 => 1,
				pg_expand_array => 1,
				pg_errorlevel => 2,
				ShowErrorStatement => 1,
#				HandleError => sub { $self->error(shift); },
				mysql_enable_utf8 => 1,
				mysql_auto_reconnect => 1,
				mysql_unsafe_bind_type_guessing => 2,
#				mysql_connect_timeout => 60,
				mysql_write_timeout => 60,
				mysql_read_timeout => 60,
				#mysql_init_command      => q{SET NAMES 'utf8';SET CHARACTER SET 'utf8'},
				AutoCommit => 1,  # Turn off autocommit to allow rollback.
				PrintError => 0,  # I create my own error messages using $handle->errstr
				RaiseError => 0   # I use die within eval to raise exceptions.
			}	
		) || do { print STDERR "error db adv connection: $DBI::errstr\n"; if ($self->cval->{SYSTEM}) { die $DBI::errstr; } else { return undef;  } } ;

		$self->db_pool_adv->{$$ . "_" . $options->{server_id}}->do("SET CLIENT_ENCODING TO 'UTF8'");
		if ($self->cval->{WEB}) { $self->db_pool_adv->{$$ . "_" . $options->{server_id}}->do("SET query_cache_type = 1"); }
		if ($self->cval->{SYSTEM}) {
			$self->db_pool_adv->{$$ . "_" . $options->{server_id}}->do("SET net_read_timeout = 1000");
			$self->db_pool_adv->{$$ . "_" . $options->{server_id}}->do("SET net_wriet_timeout = 1000");			
		}

	}
	return $self->db_pool_adv->{$$ . "_" . $options->{server_id}};
}

sub db
{
	my $self =  shift;
	my $options = shift || {};

	if (exists($ENV{MYSQL_FORCE}) && $ENV{MYSQL_FORCE}) {
		$options->{force} = 1;
	}

	
	if (!exists($options->{server_id})) { $options->{server_id} = $self->dbdata->{current_server}; }
	if ($self->current_db) { $options->{server_id} = $self->current_db; }

	load_class('DBD::' . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB'}->{'DRV'});
	#load_class('Tie::Cache::LRU');

	if (!$self->db_pool->{$$ . "_" . $options->{server_id}} || $options->{force}) {
		$self->stmt_pool({});
		$self->db_pool->{$$ . "_" . $options->{server_id}} = DBI->connect("dbi:" . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB'}->{'DRV'} . ":dbname=" . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB'}->{'NAME'} . ";port=" . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB'}->{'PORT'} . ";host=" . $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB'}->{'HOST'}, 
				$self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB'}->{'USER'}, $self->dbdata->{servers}->{$options->{server_id}}->{cfg}->{'DB'}->{'PASSWD'},
			{
				pg_auto_escape => 1,
				pg_enable_utf8 => 1,
				pg_expand_array => 1,
				pg_errorlevel => 2,
				ShowErrorStatement => 1,
#				HandleError => sub { $self->error(shift); },
				mysql_enable_utf8 => 1,
				mysql_auto_reconnect => 1,
				mysql_unsafe_bind_type_guessing => 2,
#				mysql_connect_timeout => 100,
#				mysql_write_timeout => 100,
#				mysql_read_timeout => 100,
				#mysql_init_command      => q{SET NAMES 'utf8';SET CHARACTER SET 'utf8'},
				AutoCommit => 1,  # Turn off autocommit to allow rollback.
				PrintError => 0,  # I create my own error messages using $handle->errstr
				RaiseError => 0   # I use die within eval to raise exceptions.
			}	
		) || do { print STDERR "error db connection: $DBI::errstr\n"; if ($self->cval->{SYSTEM}) { die $DBI::errstr; } else { return undef;  } } ;

		$self->db_pool->{$$ . "_" . $options->{server_id}}->do("SET CLIENT_ENCODING TO 'UTF8'");
		if ($self->cval->{WEB}) { $self->db_pool->{$$ . "_" . $options->{server_id}}->do("SET query_cache_type = 0"); }

		#if ($self->cval->{WEB}) { $self->db_pool->{$$ . "_" . $options->{server_id}}->{CachedKids} = $self->sysdata->{PREPARED};	}
	}
	

	return $self->db_pool->{$$ . "_" . $options->{server_id}};
}

