sub config_env
{
	my $self = shift;
	my $env = shift;

	#if (exists($env->{HTTP_X_FORWARDED_FOR}) && $env->{HTTP_X_FORWARDED_FOR} =~ /^240/) {
	#	$env->{REMOTE_ADDR} = '66.249.82.94';
	#	#print STDERR "ipv6 dump: " . Dumper($env);
	#}



	if (exists($env->{'HTTP_X_REAL_IP'}) && $env->{HTTP_X_REAL_IP} =~ /\d+\.\d+\.\d+\.\d+/) {
		my @ips = ($env->{'HTTP_X_REAL_IP'} =~ /(\d+\.\d+\.\d+\.\d+)/g);
		$env->{'REMOTE_ADDR'} = $ips[$#ips];
	}
	if (exists($env->{HTTP_FORWARDED}) && $env->{HTTP_FORWARDED} =~ /for\=(\d+\.\d+\.\d+\.\d+)/) {
		#print STDERR "google comrpession dump: " . Dumper($env);
		$env->{'REMOTE_ADDR'} = $1;
	}
	return $env;
}

